function loadQuality(){var a=localStorage.getItem("ytQuality");"highres"==a?document.getElementById("ytQ4").checked="true":"hd1080"==a?document.getElementById("ytQ3").checked="true":"hd720"==a?document.getElementById("ytQ2").checked="true":"default"==a&&(document.getElementById("ytQ1").checked="true")}function loadSize(){"0"==localStorage.getItem("ytSize")?document.getElementById("ytS1").checked="true":document.getElementById("ytS2").checked="true"}
function updateQuality(){var a="";document.getElementById("ytQ4").checked?a="highres":document.getElementById("ytQ3").checked?a="hd1080":document.getElementById("ytQ2").checked?a="hd720":document.getElementById("ytQ1").checked&&(a="default");localStorage.setItem("ytQuality",a)}function updateSize(){var a="";document.getElementById("ytS1").checked?a="0":document.getElementById("ytS2").checked&&(a="1");localStorage.setItem("ytSize",a)}
function loadHistoryWL(){for(var a="",b=JSON.parse(localStorage.getItem("historyWL")),c=b.length-1;0<=c;c--)a+="<option value="+c.toString()+">"+b[c]+"</option>\n";document.getElementById("history").innerHTML=a}function loadCookiesWL(){for(var a="",b=JSON.parse(localStorage.getItem("cookiesWL")),c=b.length-1;0<=c;c--)a+="<option value="+c.toString()+">"+b[c]+"</option>\n";document.getElementById("cookies").innerHTML=a}
function addToHistoryWL(){var a=document.getElementById("addhistinput").value,b=JSON.parse(localStorage.getItem("historyWL"));b[b.length]=a;localStorage.setItem("historyWL",JSON.stringify(b));console.log(b);loadHistoryWL()}function addToCookiesWL(){var a=document.getElementById("addcookiesinput").value,b=JSON.parse(localStorage.getItem("cookiesWL"));b[b.length]=a;localStorage.setItem("cookiesWL",JSON.stringify(b));loadCookiesWL()}
function deleteHistoryEntries(){for(var a=document.getElementById("history").options,b=[],c=0;c<a.length;c++){var d=a[a.length-1-c];d.selected||(b[b.length]=d.text)}localStorage.setItem("historyWL",JSON.stringify(b));loadHistoryWL()}function deleteCookiesEntries(){for(var a=document.getElementById("cookies").options,b=[],c=0;c<a.length;c++){var d=a[a.length-1-c];d.selected||(b[b.length]=d.text)}localStorage.setItem("cookiesWL",JSON.stringify(b));loadCookiesWL()}
function exec(){loadQuality();loadSize();loadHistoryWL();loadCookiesWL();document.getElementById("ytQ1").addEventListener("click",updateQuality);document.getElementById("ytQ2").addEventListener("click",updateQuality);document.getElementById("ytQ3").addEventListener("click",updateQuality);document.getElementById("ytQ4").addEventListener("click",updateQuality);document.getElementById("ytS1").addEventListener("click",updateSize);document.getElementById("ytS2").addEventListener("click",updateSize);document.getElementById("addhist").addEventListener("click",
addToHistoryWL);document.getElementById("addcookies").addEventListener("click",addToCookiesWL);document.getElementById("delhist").addEventListener("click",deleteHistoryEntries);document.getElementById("delcookies").addEventListener("click",deleteCookiesEntries)}document.addEventListener("DOMContentLoaded",exec);
